import React from "react";

function Header() {
  return (
    <div className="Header">
      <div>
        <div className="log"></div>
        <div className="name"></div>
      </div>
      <div className="menu">
        <div className="item1">홈</div>
        <div className="item2">시리즈</div>
        <div className="item3">영화</div>
        <div className="item4">NEW! 요즘 대세 콘텐츠</div>
      </div>
    </div>
  );
}

export default Header;
